insert  into `broadcasts`(`id`,`subject`,`text`,`created_at`,`updated_at`) values (1,'test broadcast','If you would like to determine if the current request was routed to a given named route, you may use the named method on a Route instance. For example, you may check the current route name from a route middleware:\r\n\r\nRoute groups allow you to share route attributes, such as middleware or namespaces, across a large number of routes without needing to define those attributes on each individual route. Shared attributes are specified in an array format as the first parameter to the Route::group method.\r\n\r\nNested groups attempt to intelligently \"merge\" attributes with their parent group. Middleware and where conditions are merged while names, namespaces, and prefixes are appended. Namespace delimiters and slashes in URI prefixes are automatically added where appropriate.','2020-11-23 01:56:34','2020-11-23 01:56:34');

