insert  into `products`(`id`,`product_type_id`,`image`,`name`,`desc`,`created_at`,`updated_at`) values (1,1,'[\"images\\/products\\/1\\/\\/pollock-half-zip.jpg\",\"images\\/products\\/1\\/\\/pollock-half-zip2.jpg\",\"images\\/products\\/1\\/\\/pollock-half-zip3.jpg\",\"images\\/products\\/1\\/\\/pollock-half-zip4.jpg\",\"images\\/products\\/1\\/\\/pollock-half-zip5.jpg\"]','Pollock Half Zip','Dedicated to Jackson Pollock, An American painter and a major figure in the abstract expressionist movement. As we admire his works and his legacy and his “pour” and splashing liquid painting style. In this season we adapt it into our newest shirt products. This shirt is available in three different models.','2020-10-07 21:07:49','2020-10-07 21:07:49'),(3,3,'[\"images\\/products\\/3\\/\\/Beanie-Black.jpg\",\"images\\/products\\/3\\/\\/Beanie-Blue.jpg\"]','Beanie-Black','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.','2020-10-07 21:16:07','2020-10-07 21:16:07'),(4,3,'[\"images\\/products\\/4\\/\\/Beanie-Blue.jpg\",\"images\\/products\\/4\\/\\/Beanie-Green.jpg\"]','Beanie-Blue','Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet,','2020-10-07 21:17:33','2020-10-07 21:17:33'),(5,2,'[\"images\\/products\\/5\\/\\/Tee-Orange-Copy.jpg\",\"images\\/products\\/5\\/\\/Tee-Purple-Copy.jpg\"]','Tee-Orange','consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?','2020-10-07 21:20:45','2020-10-07 21:20:45'),(7,3,'[\"images\\/products\\/7\\/\\/Beanie-Green.jpg\",\"images\\/products\\/7\\/\\/Beanie-Black.jpg\",\"images\\/products\\/7\\/\\/Beanie-Blue.jpg\"]','Beanie-Green','Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?','2020-10-07 21:24:37','2020-10-07 21:24:37');

